import { useState } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import Stars from "../../pages/Stars";

const Signup = () => {
	const [data, setData] = useState({
		firstName: "",
		lastName: "",
		email: "",
		password: "",
	});
	const [error, setError] = useState("");
	const navigate = useNavigate();

	const handleChange = ({ currentTarget: input }) => {
		setData({ ...data, [input.name]: input.value });
	};

	const handleSubmit = async (e) => {
		e.preventDefault();
		console.log("Signup data:", data);  // Log the data for debugging
		try {
			const url = "http://localhost:8000/api/users";
			const { data: res } = await axios.post(url, data);
			console.log(res.message);  // Log response message for debugging
			navigate("/account-created");
		} catch (error) {
			console.error("Error during signup:", error);  // Log the full error object
			if (
				error.response &&
				error.response.status >= 400 &&
				error.response.status <= 500
			) {
				setError(error.response.data.message);
			} else {
				setError("An unexpected error occurred. Please try again later.");
			}
		}

	};

	return (
		<div className="min-h-screen flex items-center justify-center bg-gradient-to-b from-indigo-900 to-blue-900 relative">
			<Stars starCount={1000}/>
			<div className="bg-[#f9f5e3] p-10 rounded-2xl shadow-2xl z-10 max-w-lg w-full">
				<h1 className="text-center text-4xl font-bold mb-8 text-gray-900">Sign Up</h1>
				<form onSubmit={handleSubmit}>
					<div className="mb-4">
						<input
							type="text"
							placeholder="First Name"
							name="firstName"
							onChange={handleChange}
							value={data.firstName}
							required
							className="w-full p-3 border border-red-500 rounded-lg focus:outline-none focus:border-indigo-500"
						/>
						<p className="text-red-500 text-sm mt-1">Please write your first name.</p>
					</div>
					<div className="mb-4">
						<input
							type="text"
							placeholder="Last Name"
							name="lastName"
							onChange={handleChange}
							value={data.lastName}
							required
							className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:border-indigo-500"
						/>
					</div>
					<div className="mb-4">
						<input
							type="email"
							placeholder="Email"
							name="email"
							onChange={handleChange}
							value={data.email}
							required
							className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:border-indigo-500"
						/>
					</div>
					<div className="mb-4">
						<input
							type="password"
							placeholder="Password"
							name="password"
							onChange={handleChange}
							value={data.password}
							required
							className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:border-indigo-500"
						/>
					</div>
					<div className="mb-4">
						<input
							type="password"
							placeholder="Confirm Password"
							name="confirmPassword"
							onChange={handleChange}
							value={data.confirmPassword}
							required
							className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:border-indigo-500"
						/>
					</div>
					{error && <div className="text-red-500 text-sm mb-4">{error}</div>}
					<button type="submit" className="w-full py-3 bg-black text-white rounded-lg hover:bg-gray-800 transition duration-300">
						SIGN UP
					</button>
				</form>
				<div className="text-center mt-6">
					<span className="text-gray-600">Already have an account? </span>
					<Link to="/login" className="text-indigo-500 hover:underline">Sign In</Link>
				</div>
			</div>
		</div>
	);
};

export default Signup;
